import { View, Text } from 'react-native'
import React from 'react'

const InsuranceHistory = () => {
  return (
    <View style={{flex: 1, justifyContent: 'center'}}>
      <Text>InsuranceHistory</Text>
    </View>
  )
}

export default InsuranceHistory
